import "./styles.css"

function App() {
  return (

        <div className='container'>
          <div className='chat-container'>
            <div className='chat'>
                Chat
            </div>
          </div>
          <div className='chat-input-container'>
            <div className='chat-input'>
              <button onClick={console.log("add question")}>
                  Question
              </button>
            </div>
          </div>
        </div>

  );
}

export default App;
